import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <form class="search-form">
        <input type="text" class="search" placeholder="search your car..." />
        <ul class="suggestions">
          <li>Filter for a city</li>
          <li>or a state</li>
        </ul>
      </form>

    </div>
  );
}

export default App;
